import React, { useEffect, useState } from 'react';

function MovieTable() {
    const [list, setList] = useState([]);
    console.log('Movie list: ', list);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const resp = await fetch('/dummy-data/movie.json');
                const data = await resp.json();
                setList(data.movies);
            } catch (err) {
                console.error('Error: ', err);
            }
        };

        fetchData();
    }, []);

    return (
        <div>
            <table>
                <thead>
                    <tr>
                        <th>Title</th>                        
                        <th>Year</th>
                        <th>Runtime</th>
                        <th>Genres</th>
                        <th>Director</th>
                        <th>Actor</th>
                    </tr>
                </thead>
                <tbody>
                    {list.map((row: any) => (
                        <tr key={row.id}>
                            <td>{row.title}</td>
                            <td>{row.year}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default MovieTable;
